import React from 'react';

const Todo = ({ todo, deleteTodo }) => {
    return (
        <div>
            <span style={{ textDecoration: todo.status === 'completed' ? 'line-through' : 'none' }}>
                {todo.description}
            </span>
            <button onClick={() => deleteTodo(todo._id)}>Delete</button>
        </div>
    );
};

export default Todo;
